import './animated-pulse-icon.scss';

import React from 'react';

const AnimatedPulseIcon = ({ children }) => (
    <div className="animated-pulse-icon">
        <div className="animated-pulse-box">
            {children}
        </div>
    </div>
);

export default AnimatedPulseIcon;
